import React, { useState, useEffect } from 'react';


const RestuList = () => {
    const [data, setData] = useState();

    const getData = async () => {
        const Response = await fetch('http://localhost:3000/restaurant');
        const result = await Response.json();
        console.log(result);
        setData(result);
    };


    useEffect(() => {
        getData();
    }, []);



    return (
        <>
            <section className="container">
                <div className="row row-cols-8 mx-auto">
                 <h2 className="text-center">Restaurant List</h2>
                </div>
            </section>
        </>
    )
}

export default RestuList;
